import logo from '../../assets/images/logoname.png';
const quick__links=[
        {
            path:'/home',
            display:'Home'
        },
        {
            path:'/about',
            display:'About'
        },
        {
            path:'/tours',
            display:'Tours'
        }
]
const quick__links2=[
    {
        path:'/gallery',
